- input: "TEXT\x1CC00167130\x1CX0\x1C\x1CF3XA\x1CThe Committee is in receipt of the
    Commissions Request for Further Information dated 5/3/2013 regarding the Year-End
    Report.   1.) The Memo entries on Schedule A now identify the correct Joint Fundraising
    Committee that each entry relates to for the transfers on Schedule A Supporting
    Line 12 for the Pre, Post, and Year-End Reports Please also note that for the
    Swing State Victory Fund there were  $172,000 in Memo's reported on the Year-End
    Report for 2011 with only a transfer of $500.  Total Transfers for this Joint
    Fundraiser were $439,868 in Transfers and $455,555.74 in Memo's. Obama Victory
    Fund Transfers were $1,060,000.00 and $1,454,011.29 in Memo's  -  2.) and 3.)
    All Memo's are now associated with the appropriate transaction and Schedule  -
    \ In addition, due to duplicates found in the database and the merging of them,
    the Lines 11(a)(i) and 11(a)(ii) have been adjusted as well.  Also, the committee
    found several instances where transfers were reported as contribution on Schedule
    A for Line 11c vs. Schedule A for Line 12.  These changes have been made and do
    affect the Detailed Summary Pages. -  Previously Filed Notes: Levin L-B Schedules
    from another date range were inadvertently included on a previously filed report.
    \ -  This report is being amended to correct itemization for memo entries to parent
    transactions that were not reporting correctly on the previously filed report
    as well as the clarification of Payments identified as Travel Stipend on this
    report that were not cash payments; furthermore, these payments were monthly stipend
    payments in accordance with policies of the committee and not a reimbursement
    for any specific travel expense. In addition, a duplicate in the database was
    discovered and merged which in turn made the donor move from un-itemized to itemized
    which is reflected on the detailed summary pages. - Employees that were disclosed
    on Schedule H4 supporting Line 21(a) and Schedule B supporting Line 21(b) as payroll
    spent less than 25% of their time during the period working on any Federal Election
    Activity or activities in connection with a Federal Election therefore salary
    payments were allocable.  This also includes fringe benefits for those specific
    employees. - Any fundraising activity on this report was for the sole benefit
    of the Committee and was not attributable to any candidate for federal office.
    - Memo Schedule A's that itemize the committees share of the gross contributions
    received through the joint fundraising activities from the Keystone Victory Fund
    are provided on this report. The transfer of the joint fundraising proceeds received
    during this reporting period represents the committee's share of proceeds for
    contributions received this period. - Memo Schedule A's that itemize the committees
    share of the gross contributions received through the joint fundraising activities
    from the DNC State Party Victory Fund and or ASDC Dollars for Democrats are provided
    on a quarterly basis. The transfer of the joint fundraising proceeds received
    during this reporting period represents the committee's share of proceeds for
    contributions received during this or prior reporting periods. The memo entries
    for these contributions are included in this or a prior report of the committee.
    - No national transfers were designated for any activity that meets the definition
    of exempt.\n"
